package TimeA;

public class TimeA {

	String nome;
	int id;
	String idade;
	
	public TimeA() {
		// TODO Auto-generated constructor stub
	}

	public TimeA(String nome, int id, String idade) {
		this.nome = nome;
		this.id = id;
		this.idade = idade;
	}
	
	public void setNome(String nome) {
		this.nome = nome;
	}

	public String getNome() {
		return nome;
	}
	
	
	public void setID(int id) {
		this.id = id;
	}

	public int getID() {
		return id;
	}


	public void setIdade(String idade) {
		this.idade = idade;
	}

	public String getIdade() {
		return nome;
	}
	
}
